# Set up the plot
fig, ax = plt.subplots()
cmap = plt.cm.viridis  # color map

# Normalize density for coloring
densities = [d['attributes']['USCBmodel_dens'] for d in data]
min_d, max_d = min(densities), max(densities)

# Plot each polygon
for entry in data:
    ring = entry['geometry']['rings'][0]
    density = entry['attributes']['USCBmodel_dens']

    # Convert relative coordinates to absolute polygon points
    points = []
    x, y = 0, 0
    for dx, dy in ring:
        x += dx
        y += dy
        points.append((x, y))

    poly = Polygon(points)
    x, y = poly.exterior.xy
    norm_density = (density - min_d) / (max_d - min_d)
    ax.fill(x, y, color=cmap(norm_density), edgecolor='black')

# Add colorbar
sm = plt.cm.ScalarMappable(cmap=cmap, norm=plt.Normalize(vmin=min_d, vmax=max_d))
sm.set_array([])
cbar = plt.colorbar(sm, ax=ax)
cbar.set_label("USCB Model Density")

# Finish up
ax.set_aspect('equal')
plt.title("Polygon Visualization with USCB Model Density")
plt.show()